import React from 'react';
import './buttontext.css';

interface ButtonProps {
  href?: string;
  onClick?: () => void;
  label?: string;
}

const Buttontext: React.FC<ButtonProps> = ({ href, onClick = () => {}, label = "Buttontext" }) => {
  if (href) {
    return (
      <a href={href} className="textbutton">
        {label}
      </a>
    );
  } else {
    return (
      <span className="textbutton" onClick={onClick}>
        {label}
      </span>
    );
  }
};

export default Buttontext;
